import React from 'react';
import ReactDOM from 'react-dom/client';
// Mengimpor komponen utama dari dashboard.jsx
import App from '../dashboard.jsx';

// Dapatkan elemen root dari public/index.html
const rootElement = document.getElementById('root');
const root = ReactDOM.createRoot(rootElement);

// Render aplikasi React
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Catatan: Pastikan file dashboard.jsx berada di level yang sama dengan folder src/
// atau atur path impor di atas (../dashboard.jsx) agar sesuai dengan struktur Anda.
